Originally, kimchi is based on an interactive protocol that was transformed into a non-interactive one using the Fiat-Shamir transform. For this reason, it can be useful to visualize the high-level interactive protocol before the transformation: sequenceDiagram participant Prover participant Verifier Prover-&gt;&gt;Verifier: public input &amp; witness commitment Verifier-&gt;&gt;Prover: beta &amp; gamma Prover-&gt;&gt;Verifier: permutation commitment Verifier-&gt;&gt;Prover: alpha Prover-&gt;&gt;Verifier: quotient commitment Verifier-&gt;&gt;Prover: zeta Note over Verifier: change of verifier (change of sponge) Prover-&gt;&gt;Verifier: negated public input p(zeta) &amp; p(zeta * omega) Prover-&gt;&gt;Verifier: permutation poly z(zeta) &amp; z(zeta * omega) Prover-&gt;&gt;Verifier: the generic selector gen(zeta) &amp; gen(zeta * omega) Prover-&gt;&gt;Verifier: the poseidon selector pos(zeta) &amp; pos(zeta * omega) Prover-&gt;&gt;Verifier: the 15 registers w_i(zeta) &amp; w_i(zeta * omega) Prover-&gt;&gt;Verifier: the 6 sigmas s_i(zeta) &amp; s_i(zeta * omega) Prover-&gt;&gt;Verifier: ft(zeta * omega) Verifier-&gt;&gt;Prover: u, v Note over Verifier: change of verifier (change of sponge) Prover-&gt;&gt;Verifier: evaluation proof (involves more interaction) The Fiat-Shamir transform simulates the verifier messages via a hash function that hashes the transcript of the protocol so far before outputing verifier messages. You can find these operations under the proof creation and proof verification algorithms as absorption and squeezing of values with the sponge. A proof consists of: a number of (hidden) polynomial commitments: the 15 registers/witness columns the permutation the quotient TODO: lookup TODO: public commitment is not here, but is in the sequence diagram evaluations of these polynomials at two random points ζ and ζω evaluations at the two random points of these additional polynomials: the 6 s (sigma) TODO: lookup generic selector poseidon selector evaluation at ζω of ft optionally, the public input used (the public input could be implied by the surrounding context and not part of the proof itself) optionally, the previous challenges (in case we are in a recursive prover) From the code: #[derive(Clone)]
pub struct LookupEvaluations<Field> { /// sorted lookup table polynomial pub sorted: Vec<Field>, /// lookup aggregation polynomial pub aggreg: Field, // TODO: May be possible to optimize this away? /// lookup table polynomial pub table: Field,
} // TODO: this should really be vectors here, perhaps create another type for chuncked evaluations?
#[derive(Clone)]
pub struct ProofEvaluations<Field> { /// witness polynomials pub w: [Field; COLUMNS], /// permutation polynomial pub z: Field, /// permutation polynomials /// (PERMUTS-1 evaluations because the last permutation is only used in commitment form) pub s: [Field; PERMUTS - 1], /// lookup-related evaluations pub lookup: Option<LookupEvaluations<Field>>, /// evaluation of the generic selector polynomial pub generic_selector: Field, /// evaluation of the poseidon selector polynomial pub poseidon_selector: Field,
} /// Commitments linked to the lookup feature
#[derive(Clone)]
pub struct LookupCommitments<G: AffineCurve> { pub sorted: Vec<PolyComm<G>>, pub aggreg: PolyComm<G>,
} /// All the commitments that the prover creates as part of the proof.
#[derive(Clone)]
pub struct ProverCommitments<G: AffineCurve> { /// The commitments to the witness (execution trace) pub w_comm: [PolyComm<G>; COLUMNS], /// The commitment to the permutation polynomial pub z_comm: PolyComm<G>, /// The commitment to the quotient polynomial pub t_comm: PolyComm<G>, /// Commitments related to the lookup argument pub lookup: Option<LookupCommitments<G>>,
} /// The proof that the prover creates from a [ProverIndex] and a `witness`.
#[derive(Clone)]
pub struct ProverProof<G: AffineCurve> { /// All the polynomial commitments required in the proof pub commitments: ProverCommitments<G>, /// batched commitment opening proof pub proof: OpeningProof<G>, /// Two evaluations over a number of committed polynomials // TODO(mimoo): that really should be a type Evals { z: PE, zw: PE } pub evals: [ProofEvaluations<Vec<ScalarField<G>>>; 2], /// Required evaluation for [Maller's optimization](https://o1-labs.github.io/mina-book/crypto/plonk/maller_15.html#the-evaluation-of-l) pub ft_eval1: ScalarField<G>, /// The public input pub public: Vec<ScalarField<G>>, /// The challenges underlying the optional polynomials folded into the proof pub prev_challenges: Vec<(Vec<ScalarField<G>>, PolyComm<G>)>,
} The following sections specify how a prover creates a proof, and how a verifier validates a number of proofs.
